import Foodcard from './Foodcard';
import HomeNav from './HomeNav';

function App() {
  return (
    <div className="App">
      <>
      <HomeNav />
      <div className="container">

      </div>
        <Foodcard name = "Paneer Pizza" descrip="Flavorful trio: paneer, capsicum, red paprika"/>
      </>
    </div>
  );
}

export default App;
